class Solution {

    /**
     * @param Integer[] $nums
     * @return Integer
     */
    function continuousSubarrays($nums) {
        $count = 0;
        $n = count($nums);

        for ($start = 0; $start < $n; $start++) {
            $maxDiff = 0;
            $minVal = PHP_INT_MAX;
            $maxVal = PHP_INT_MIN;
            for ($end = $start; $end < $n; $end++) {
                $minVal = min($minVal, $nums[$end]);
                $maxVal = max($maxVal, $nums[$end]);
                // Check if the current subarray is continuous
                if ($maxVal - $minVal <= 2) {
                    $count++; // valid continuous subarray
                } else {
                    break; // current subarray is not continuous, break the inner loop
                }
            }
        }

        return $count;
    }
}
